import styled from "styled-components";
import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { useSelector, useDispatch } from "react-redux";

import { deleteTodo, updateTodo } from "../../redux/modules/todos";

import Todo from "../todo/Todo";

const TextStyle = styled.h2`
  color: white;
  text-shadow: 3px 2px 2px #dc83ff;
  padding-top: 50px;
`;

function List() {
  const navigate = useNavigate();
  const dispatch = useDispatch();
  const todolists = useSelector((state) => state.todos);
  console.log(todolists);
  return (
    <div>
      <TextStyle>working</TextStyle>
      {todolists.map((todolist) =>
        todolist.done === false ? (
          <div key={todolist.id}>
            <Todo todolist={todolist} />
          </div>
        ) : null
      )}
      <TextStyle>done</TextStyle>
      {todolists.map((todolist) =>
        todolist.done === true ? (
          <div key={todolist.id}>
            <Todo todolist={todolist} />
          </div>
        ) : null
      )}
    </div>
  );
}

export default List;
